import React from "react";
import swal from "sweetalert"

export const error = () => {
    swal({
        title: "HA OCURRIDO UN ERROR",
        icon: "error",
        button: "Aceptar",
        timer: "1500"

    })

}

export const emailUsed = () => {
    swal({
        title: "HA OCURRIDO UN ERROR",
        text: "El correo ingresado ya esta en uso",
        icon: "error",
        button: "Aceptar",
        timer: "1500"

    })

}


export const successRegistration = () => {
    swal({
        title: "REGISTRO EXITOSO",
        text: "El correo ingresado ya esta en uso",
        icon: "success",
        button: "Aceptar",
        timer: "1500"

    })



}
